INSERT INTO `t_blog` VALUES ('10', '', '', '@babel/preset-env#\r\n从上面的插件化我们就知道需要哪个插件就去引入就完事儿，那么问题来了，es6新增的语法那么多，我总不能一个插件一个插件去添加吧，这样也太麻烦了，这个时候就要用到babel提供的presets了。\r\n\r\npresets也就是预设的意思，大概意思就是可以预先设定好一些东西，就省得我们一个个的去引入插件了。官方提供了很多presets，比如preset-env（处理es6+规范语法的插件集合）、preset-stage（一些处理尚在提案阶段的语法的插件集合，当然这种预设的方式在 babel 7+ 版本已经被废弃了）、preset-react（处理react语法的插件集合）等等。\r\n\r\n我们主要来介绍下preset-env：preset-env是一个智能预设，配置了它就可以让你用es6+去书写你的代码，而且他会按需去加载所需要的插件，让你的生活更加美好。。。接下来我们记得先install这个 @babel/preset-env一波，不配任何插件，然后我们再来看看效果如何：\r\n\r\nCopy\r\n/* babel.config.js */\r\n\r\nmodule.exports = {\r\n  presets: [\r\n    \"@babel/preset-env\"\r\n  ],\r\n  plugins: [\r\n  ]\r\n}\r\n对应的es6语法就会变成：\r\n\r\nCopy\r\n/* study.js */\r\nconst study = () => {}\r\n\r\nconst arr1 = [1, 2, 33]\r\nconst arr2 = [...arr1]\r\n\r\nconst exponentiation = 2 ** 2\r\n\r\n// 新增API\r\nnew Promise(() => {})\r\nnew Map()\r\n\r\n\r\n/* study-compiled.js */\r\nvar study = function study() {};\r\n\r\nvar arr1 = [1, 2, 33];\r\nvar arr2 = [].concat(arr1);\r\nvar exponentiation = Math.pow(2, 2);\r\n\r\n// 新增API\r\nnew Promise(function () {});\r\nnew Map();\r\n你会发现es6+的语法都被编译了，我们并没有设置任何插件哦，应该也看到了新增的API方法并没有被编译，在这里我们埋下伏笔，等下文讲到polyfill的时候再治他。\r\n\r\nBrowserslist集成\r\n关于preset-env，我们还可以提供一个targets配置项指定运行环境，就是我们可以配置对应目标浏览器环境，那么babel就会编译出对应目标浏览器环境可以运行的代码。相信有同学遇到过在低版本系统ios手机里自己的项目会白屏，其实是某些语法在ios低版本系统里不支持，这个时候我们可以直接配置ios 7浏览器环境都可以支持的代码：\r\n\r\nCopy\r\n/* babel.config.js */\r\n\r\nmodule.exports = {\r\n  presets: [\r\n    [\r\n      \"@babel/preset-env\", {\r\n        \'targets\': {\r\n          \'browsers\': [\'ie >= 8\', \'iOS 7\'] // 支持ie8，直接使用iOS浏览器版本7\r\n        }\r\n      }\r\n    ]\r\n  ],\r\n  plugins: [\r\n  ]\r\n}\r\n当然babel的Browserslist集成还支持在package.json文件里或者新建一个 .browserslistrc 文件来指定对应目标环境。browserslist配置源\r\n\r\n\r\n@babel/polyfill(由core-js2和regenerator-runtime组成的一个集成包)#\r\n上文也提到了像Promise这种API咱们的babel并没有给转义，那是因为babel默认是只会去转义js语法的，不会去转换新的API，比如像Promise、Generator、Symbol这种全局API对象，babel是不会去编译的，这个时候就要掏出 @babel/polyfill 了。用法很简单，先安装一波，然后我们只需要在入口文件顶部引入 @babel/polyfill 就可以使用新增的API了。\r\n\r\nCopy\r\n/* study.js */\r\nimport \'@babel/polyfill\'\r\n// 新增API\r\nnew Promise(function () {});\r\n\r\n/* study-compiled.js */\r\nrequire(\"@babel/polyfill\");\r\n// 新增API\r\nnew Promise(function () {});', '2020-03-01 14:03:24.561000', '你会发现es6+的语法都被编译了，我们并没有设置任何插件哦，应该也看到了新增的API方法并没有被编译，在这里我们埋下伏笔，等下文讲到polyfill的时候再治他。', 'https://timgsa.baidu.com/timg?image&quality=80&size=b9999_10000&sec=1583080025496&di=03ba711158b17e207a8d6b9c5677fdbf&imgtype=0&src=http%3A%2F%2Fimg2.yiihuu.com%2Fupimg%2Fmanage%2F2015%2F09%2F15%2F14422855791647.jpg', '1', '', '', '', 'spark', '2020-03-01 14:03:24.561000', '1', '2', '1');
INSERT INTO `t_blog` VALUES ('11', '', '', '## 代码测试\r\n```java\r\nmodule.exports = {\r\n  presets: [\r\n    [\r\n      \"@babel/preset-env\", {\r\n        \'targets\': {\r\n          \'browsers\': [\'ie >= 8\', \'iOS 7\'] // 支持ie8，直接使用iOS浏览器版本7\r\n        }\r\n      }\r\n    ]\r\n  ],\r\n  plugins: [\r\n  ]\r\n}\r\n```', '2020-03-02 00:16:45.102000', 'ssdsdsdsdsdsdsdsd', 'https://timgsa.baidu.com/timg?image&quality=80&size=b9999_10000&sec=1583080025496&di=03ba711158b17e207a8d6b9c5677fdbf&imgtype=0&src=http%3A%2F%2Fimg2.yiihuu.com%2Fupimg%2Fmanage%2F2015%2F09%2F15%2F14422855791647.jpg', '1', '', '', '', '再次测试哈哈哈哈哈', '2020-03-02 00:16:45.102000', '12', '3', '1');
