INSERT INTO `t_blog` VALUES ('31', '\0', '\0', '第一个维度是协议层次。\r\n\r\n它和 TCP 协议栈的概念是相同的，需要从两层、三层、四层一层层地摞上去，发包的时候从右往左，即先有应用数据，然后发到了 TCP 或者 UDP 的四层协议，继续向下传送，加上 IP 头，再加上 MAC 头就可以送出去了。收包的时候则按照相反的顺序，首先剥离 MAC 的头，再剥离 IP 的头，最后通过协议号在端口找到需要接收的进程。\r\n\r\n第二维度是网络拓扑。\r\n\r\n一个容器的包所要解决的问题分为两步：第一步，如何从容器的空间 (c1) 跳到宿主机的空间 (infra)；第二步，如何从宿主机空间到达远端。\r\n\r\n我个人的理解是，容器网络的方案可以通过接入、流控、通道这三个层面来考虑。\r\n\r\n    第一个是接入，就是说我们的容器和宿主机之间是使用哪一种机制做连接，比如 Veth + bridge、Veth + pair 这样的经典方式，也有利用高版本内核的新机制等其他方式（如 mac/IPvlan 等），来把包送入到宿主机空间；\r\n\r\n    第二个是流控，就是说我的这个方案要不要支持 Network Policy，如果支持的话又要用何种方式去实现。这里需要注意的是，我们的实现方式一定需要在数据路径必经的一个关节点上。如果数据路径不通过该 Hook 点，那就不会起作用；\r\n\r\n    第三个是通道，即两个主机之间通过什么方式完成包的传输。我们有很多种方式，比如以路由的方式，具体又可分为 BGP 路由或者直接路由。还有各种各样的隧道技术等等。最终我们实现的目的就是一个容器内的包通过容器，经过接入层传到宿主机，再穿越宿主机的流控模块（如果有）到达通道送到对端。\r\n\r\n一个最简单的路由方案：Flannel-host-gw\r\n\r\n这个方案采用的是每个 Node 独占网段，每个 Subnet 会绑定在一个 Node 上，网关也设置在本地，或者说直接设在 cni0 这个网桥的内部端口上。该方案的好处是管理简单，坏处就是无法跨 Node 迁移 Pod。就是说这个 IP、网段已经是属于这个 Node 之后就无法迁移到别的 Node 上。', '2020-03-03 04:23:46.712000', 'sss', 'sss', '', '', '', '\0', '时间', '2020-03-03 04:23:46.712000', '2', '1', '1');
INSERT INTO `t_blog` VALUES ('32', '\0', '\0', '2、“浅计算”与其它问题\r\n\r\n有个概念叫“浅拷贝”，指的是 copy() 方法只拷贝引用对象的内存地址，而非实际的引用对象。类比于这个概念，我们可以认为 getsizeof() 是一种“浅计算”。\r\n\r\n“浅计算”不关心真实的对象，所以其计算结果只是一个假象。这是一个值得注意的问题，但是注意到这点还不够，我们还可以发散地思考如下的问题：\r\n\r\n    “浅计算”方法的底层实现是怎样的？\r\n    为什么 getsizeof() 会采用“浅计算”的方法？\r\n\r\n关于第一个问题，getsizeof(x) 方法实际会调用 x 对象的__sizeof__() 魔术方法，对于内置对象来说，这个方法是通过 CPython 解释器实现的。\r\n\r\n我查到这篇文章《Python中对象的内存使用(一)》，它分析了 CPython 源码，最终定位到的核心代码是这一段：\r\n\r\n/*longobject.c*/\r\n\r\nstatic Py_ssize_t\r\nint___sizeof___impl(PyObject *self)\r\n{\r\n    Py_ssize_t res;\r\n\r\n    res = offsetof(PyLongObject, ob_digit) + Py_ABS(Py_SIZE(self))*sizeof(digit);\r\n    return res;\r\n}\r\n\r\n我看不懂这段代码，但是可以知道的是，它在计算 Python 对象的大小时，只跟该对象的结构体的属性相关，而没有进一步作“深度计算”。', '2020-03-03 04:26:44.479000', '啊', 's', '', '', '', '\0', 'python', '2020-03-03 04:26:44.479000', '3', '1', '1');
INSERT INTO `t_blog` VALUES ('33', '\0', '\0', '1.首先安装zookeeper 启动zookeeper\r\nbin/zkServer.sh start\r\n2.kafka集群部署\r\nbroker.id=1\r\ndelete.topic.enable=true\r\nlog.dirs=/bigdata/kafka_2.11-0.10.2.1/data\r\nzookeeper.connect=node-1.xiaoniu.com:2181,node-2.xiaoniu.com:2181,node-3.xiaoniu.com:2181\r\n分发带三台机器\r\n\r\nbroker.id=2 \r\nbroker.id=3\r\n\r\n3.启动kafka\r\n\r\nbin/kafka-server-start.sh -daemon /root/apps/kafka_2.11-0.11.0.3/config/server.properties\r\n\r\n4.停止kafka\r\n/bigdata/kafka_2.11-0.10.2.1/bin/kafka-server-stop.sh \r\n\r\n\r\n5.创建topic\r\n/bigdata/kafka_2.11-0.10.2.1/bin/kafka-topics.sh --create --zookeeper node-1.xiaoniu.com:2181,node-2.xiaoniu.com:2181,node-3.xiaoniu.com:2181 --replication-factor 3 --partitions 3 --topic my-topic\r\n\r\n\r\n6.列出所有topic\r\nbin/kafka-topics.sh --list --zookeeper hadoop6:2181,hadoop7:2181,hadoop8:2181\r\n\r\n7.查看某个topic信息\r\n/bigdata/kafka_2.11-0.10.2.1/bin/kafka-topics.sh --describe --zookeeper node-1.xiaoniu.com:2181,node-2.xiaoniu.com:2181,node-3.xiaoniu.com:2181 --topic my-topic\r\n\r\n8.启动一个命令行的生产者\r\n/bigdata/kafka_2.11-0.10.2.1/bin/kafka-console-producer.sh --broker-list node-1.xiaoniu.com:9092,node-1.xiaoniu.xom:9092,node-3.xiaoniu.com:9092 --topic xiaoniu\r\n\r\n9.启动一个命令行的消费者\r\n/bigdata/kafka_2.11-0.10.2.1/bin/kafka-console-consumer.sh --zookeeper node-1.xiaoniu.com:2181,node-2.xiaoniu.com:2181,node-3.xiaoniu.com:2181 --topic my-topic --from-beginning\r\n\r\n# 消费者连接到borker的地址\r\n/bigdata/kafka_2.11-0.10.2.1/bin/kafka-console-consumer.sh --bootstrap-server node-1.xiaoniu.com:9092,node-2.xiaoniu.com:9092,node-3.xiaoniu.com:9092 --topic xiaoniu --from-beginning \r\n\r\n\r\nKafka Connect: \r\nhttps://kafka.apache.org/documentation/#connect \r\nhttp://docs.confluent.io/2.0.0/connect/connect-jdbc/docs/index.html\r\n\r\nKafka Stream: \r\nhttps://kafka.apache.org/documentation/streams \r\nhttps://spark.apache.org/docs/1.6.1/streaming-kafka-integration.html\r\n\r\nkafka monitor: \r\nhttps://kafka.apache.org/documentation/#monitoring \r\nhttps://github.com/quantifind/KafkaOffsetMonitor \r\nhttps://github.com/yahoo/kafka-manager\r\n\r\nkafka生态圈： \r\nhttps://cwiki.apache.org/confluence/display/KAFKA/Ecosystem\r\n', '2020-03-03 04:31:34.172000', 'ddd', 'sss', '', '', '', '\0', 'kafuka', '2020-03-03 04:31:34.172000', '8', '1', '1');
